import Video from './demo_vids/weapon.mp4';
import Poster from './demo_vids/weapon.jpg';
import Img from './images/weapon.png';
export const weapon = {
    lightBg: false,
    lightText: true,
    lightTextDesc: true,
    headline: 'Weapon Detection',
    description:
      'For any institute/organization, security is one of the most important feature. For this, our product would be trained to detect any sort of weapons (i.e., Guns, Knives etc.). Once detected, it would alert the administration accordingly.',
    imgStart: '',
    img: Img,
    alt: 'Credit Card',
    path: Video,
    poster: Poster
  };
